  componentDidMount() {
    this.props.getAllStudents();
  }
  render() {
    return (
      <div>
        <Students />
      </div>
    );
  }
}

const mapStateToProps = state => {
  console.log(state);
  return {};
};

export default connect(
  mapStateToProps,
  { getAllStudents }
